INSERT INTO `wp_postmeta` VALUES (1525,304,'eventscontent','Op 26 februari vieren we ons 1 jarig bestaan van onze winkel te Desselgem. Wegens corona zal dit in bubbel gevierd worden.\r\nWie de week van 26 februari langs komt krijgt een kleine attentie na een aankoop.\r\nWe kijken er naar uit om onze klanten nog jaren te mogen ontvangen.');
INSERT INTO `wp_postmeta` VALUES (1526,304,'_eventscontent','field_5ff9a89630516');
INSERT INTO `wp_postmeta` VALUES (1527,298,'eventscontent','Sinds 15 december 2020 is ons 4 de filiaal te vinden in Ooigem. \r\nDaarom organiseren we een opendeurdag. Wegens corona zal dit er een beetje anders uitzien.\r\nElke klant die op 16 januari langskomt in onze winkel zal 20 % korting krijgen op hun aankoop.\r\n\r\nTot binnenkort Team Optiek-er');
