INSERT INTO `wp_posts` VALUES (73,1,'2020-12-31 14:30:39','2020-12-31 14:30:39','<!-- wp:paragraph -->\n<p>Optiek-er heet jullie van harte welkom in onze winkel te Ooigem. Een juiste bril kiezen is geen eenvoudig karwei. Zo moet het montuur lekker zitten, juiste accenten leggen n bij jouw stijl passen. Daarnaast is  het uiteraard van belang dat je weer superscherp ziet met de juiste brilglazen.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Je moet met enkele dingen rekening houden als je een bril kiest. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Je kapsel</li><li>Je haarkleur</li><li>je gezichtsvorm</li><li>kleur van je ogen</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Je kan je ogen ook door ons laten meten indien nodig</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tot binnenkort!</p>\n<!-- /wp:paragraph -->','De juiste bril kiezen?','','publish','open','open','','new-store-on-the-way','','','2021-01-06 14:53:16','2021-01-06 14:53:16','',0,'http://webshop.local/?p=73',0,'post','',0);
INSERT INTO `wp_posts` VALUES (74,1,'2020-12-31 14:29:54','2020-12-31 14:29:54','','opticus-devilee-homeblok-2','','inherit','open','closed','','opticus-devilee-homeblok-2','','','2020-12-31 14:29:54','2020-12-31 14:29:54','',73,'http://webshop.local/wp-content/uploads/2020/12/opticus-devilee-homeblok-2.jpg',0,'attachment','image/jpeg',0);
INSERT INTO `wp_posts` VALUES (75,1,'2020-12-31 14:30:39','2020-12-31 14:30:39','<!-- wp:paragraph -->\n<p>1 januari 2021 opent onze nieuwe winkel in Ooigem. De winkel zal iets groter zijn dan onze andere filialen. We zullen onder andere nieuwe merken zoals giorgio armani, Ray-ben en nog veel meer verkopen. Ook hebben we een nieuw item in ons assortiment onze lenzen, kan je nu op maat en sterkte bestellen bij 1 van onze fillialen. Ben je op zoek naar de perfecte montuur of nieuwe glazen? dan ben je bij ons aan het juiste adress.</p>\n<!-- /wp:paragraph -->','new store on the way','','inherit','closed','closed','','73-revision-v1','','','2020-12-31 14:30:39','2020-12-31 14:30:39','',73,'http://webshop.local/73-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (76,1,'2020-12-31 14:37:46','2020-12-31 14:37:46','<!-- wp:paragraph -->\n<p>Het merk Ray-ben kent u waarschijnlijk wel,                                                     n van onze populairste merken in onze filialen.                                            </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We hebben goed nieuws voor onze klanten. Ray-ben heeft sinds kort nieuwe items gelanceerd die nu beschikbaar zijn in onze winkel.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Onze winkel is komende periode open vanaf maandag tot en met zaterdag telkens van 9:30 tot 18:30u. Indien u een afspraak wil maken kan dit telefonisch. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tot binnenkort</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"dropCap\":true} -->\n<p class=\"has-drop-cap\"> </p>\n<!-- /wp:paragraph -->','Merk Ray-ben komt met nieuwe items','','publish','open','open','','merk-ray-ben-komt-met-nieuwe-items','','','2021-01-06 15:10:32','2021-01-06 15:10:32','',0,'http://webshop.local/?p=76',0,'post','',0);
INSERT INTO `wp_posts` VALUES (77,1,'2020-12-31 14:37:46','2020-12-31 14:37:46','<!-- wp:paragraph -->\n<p>Ray-ben het populaire merk in brillen, zonnebrillen,... komt met nieuwe items voor in hun assortiment. De nieuwe ontwerpen verschillen niet zo danig veel maar er zit zeker een mooiere look in. Kom zeker een kijkje nemen!</p>\n<!-- /wp:paragraph -->','Merk Ray-ben komt met nieuwe items','','inherit','closed','closed','','76-revision-v1','','','2020-12-31 14:37:46','2020-12-31 14:37:46','',76,'http://webshop.local/76-revision-v1/',0,'revision','',0);
