INSERT INTO `wp_posts` VALUES (81,1,'2021-01-01 19:20:22','2021-01-01 19:20:22','<!-- wp:paragraph -->\n<p>Ray-ben het populaire merk in brillen, zonnebrillen,... komt met nieuwe items voor in hun assortiment. De nieuwe ontwerpen verschillen niet zo danig veel maar er zit zeker een mooiere look in. Wilt u eens de kans nemen om een montuur te passen of te bekijken? dan bent u bij ons aan het juiste adress. Kom zeker een kijkje nemen!</p>\n<!-- /wp:paragraph -->','Merk Ray-ben komt met nieuwe items','','inherit','closed','closed','','76-revision-v1','','','2021-01-01 19:20:22','2021-01-01 19:20:22','',76,'http://webshop.local/76-revision-v1/',0,'revision','',0);
