INSERT INTO `wp_posts` VALUES (116,1,'2021-01-03 19:28:35','2021-01-03 19:28:35','<!-- wp:paragraph -->\n<p>1 januari 2021 opent onze nieuwe winkel in Ooigem. De winkel zal iets groter zijn dan onze andere filialen. We zullen onder andere nieuwe merken zoals giorgio armani, Ray-ben en nog veel meer verkopen. Ook hebben we een nieuw item in ons assortiment onze lenzen, kan je nu op maat en sterkte bestellen bij 1 van onze fillialen. Ben je op zoek naar de perfecte montuur of nieuwe glazen? dan ben je bij ons aan het juiste adress.</p>\n<!-- /wp:paragraph -->','Nieuw filiaal op komst','','inherit','closed','closed','','73-revision-v1','','','2021-01-03 19:28:35','2021-01-03 19:28:35','',73,'http://webshop.local/73-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (117,1,'2021-01-03 19:56:46','2021-01-03 19:56:46','<!-- wp:paragraph -->\n<p>Onze nieuwe site is er bijna! Wij als optiek-er zijn opgestart op 15 december 2020. Contact kan je altijd opnemen via de gegevens of eens langs komen in onze winkel. </p>\n<!-- /wp:paragraph -->','Nieuwe site in aantocht!','','publish','open','open','','nieuwe-site-in-aantocht','','','2021-01-06 14:53:51','2021-01-06 14:53:51','',0,'http://webshop.local/?p=117',0,'post','',0);
