INSERT INTO `wp_posts` VALUES (212,1,'2021-01-06 14:52:35','2021-01-06 14:52:35','<!-- wp:paragraph -->\n<p>Optiek-er heet jullie van harte welkom in onze winkel te Ooigem. Een juiste bril kiezen is geen eenvoudig karwei. Zo moet het montuur lekker zitten, juiste accenten leggen n bij jouw stijl passen. Daarnaast is  het uiteraard van belang dat je weer superscherp ziet met de juiste brilglazen.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Je moet met enkele dingen rekening houden als je een bril kiest. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Je kapsel</li><li>Je haarkleur</li><li>je gezichtsvorm</li><li>kleur van je ogen</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Je kan je ogen ook door ons laten meten indien nodig</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tot binnenkort!</p>\n<!-- /wp:paragraph -->','De juiste bril kiezen?','','inherit','closed','closed','','73-revision-v1','','','2021-01-06 14:52:35','2021-01-06 14:52:35','',73,'http://webshop.local/73-revision-v1/',0,'revision','',0);
