INSERT INTO `wp_posts` VALUES (220,1,'2021-01-06 15:29:42','2021-01-06 15:29:42','<!-- wp:paragraph -->\n<p>Hou je bril onder koud of lauw stromend water en gebruik een zachte zeep of een speciale brilspray om eventuele vetresten te verwijderen. Vermijd te agressieve detergenten of afwasproducten op basis van citrusextracten. Deze kunnen immers te hard inwerken op het materiaal van je bril.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Je droogt een bril best af met een schone zachte vaatdoek die gewassen is zonder wasverzachter. Want dit kan een wazige film op je glazen achterlaten.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Hoge of lage temperaturen en je bril zijn niet de beste maatjes. Extreme temperaturen kunnen je bril immers vervormen. Te vermijden: direct en straf zonlicht, verwarmingstoestellen, onschuldige maar gevaarlijke plaatsen zoals op het dashboard van je auto of de sauna.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Wenst u meer informatie? kom dan zeker langs in onze winkel!</p>\n<!-- /wp:paragraph -->','Hoe je bril proper houden?','','publish','open','open','','hoe-je-bril-proper-houden','','','2021-01-06 15:32:07','2021-01-06 15:32:07','',0,'http://webshop.local/?p=220',0,'post','',0);
