INSERT INTO `wp_posts` VALUES (223,1,'2021-01-06 16:00:21','2021-01-06 16:00:21','<!-- wp:paragraph -->\n<p>Vanaf heden werken wij op onze normale openingsuren. Maar wel ENKEL OP AFSPRAAK . Een afspraak maken kan telefonisch. Indien u niet de gewenste afspraak kan naleven gelieve dit op voorhand te melden.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Er helden natuurlijk enkele regels in onze winkel</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Dragen van mondmasker</li><li>Ontsmetten van handen bij binnenkomst</li><li>1,5m afstand respecteren</li><li>geen brillen en dergelijke aanraken</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Wij als team helpen jullie graag verder in deze moeilijke tijden!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Team Optiek-er</p>\n<!-- /wp:paragraph -->','Veilig winkelen bij optiek-er tijdens covid-19','','publish','open','open','','veilig-winkelen-bij-optiek-er-tijdens-covid-19','','','2021-01-07 19:35:28','2021-01-07 19:35:28','',0,'http://webshop.local/?p=223',0,'post','',0);
